"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 488px\">",
"   <div class=\"ttl\">",
"    Phalanx fracture reduction: 3 point technique",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 468px; height: 312px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Reduction of a middle phalanx fracture is performed by applying longitudinal traction, and then using three-point pressure (shown above) to bring the distal fragment into alignment with the proximal fragment. Each thumb represents one point and adjacent index fingers a third point.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Rebecca Bassett, MD.",
"    </div>",
