var title_f38_58_39853="SSS TOAST Classification";
var content_f38_58_39853=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F57732&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F57732&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    CCS classification of ischemic stroke etiology",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Stroke mechanism",
"       </td>",
"       <td class=\"subtitle1\">",
"        Level of confidence",
"       </td>",
"       <td class=\"subtitle1\">",
"        Criteria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" rowspan=\"7\">",
"        Large artery atherosclerosis",
"       </td>",
"       <td rowspan=\"2\">",
"        Evident",
"       </td>",
"       <td>",
"        1. Either occlusive or stenotic (&ge;50 percent diameter reduction or &lt;50 percent diameter reduction with plaque ulceration or thrombosis) vascular disease judged to be caused by atherosclerosis in the clinically relevant extracranial or intracranial arteries",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2. The absence of acute infarction in vascular territories other than the stenotic or occluded artery",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        Probable",
"       </td>",
"       <td>",
"        1. History of &ge;1 transient monocular blindness (TMB), TIA, or stroke from the territory of index artery affected by atherosclerosis within the last month",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2. Evidence of near-occlusive stenosis or nonchronic complete occlusion judged to be caused by atherosclerosis in the clinically relevant extracranial or intracranial arteries (except for the vertebral arteries)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3. The presence of ipsilateral and unilateral internal watershed infarctions or multiple, temporally separate, infarctions exclusively within the territory of the affected artery",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Possible",
"       </td>",
"       <td>",
"        1. The presence of an atherosclerotic plaque protruding into the lumen and causing mild stenosis (&lt;50 percent) in the absence of any detectable plaque ulceration or thrombosis in a clinically relevant extracranial or intracranial artery and history of &ge;2 TMB, TIA, or stroke from the territory of index artery affected by atherosclerosis, at least 1 event within the last month",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2. Evidence for evident large artery atherosclerosis in the absence of complete diagnostic investigation for other mechanisms",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" rowspan=\"5\">",
"        Cardio-aortic embolism",
"       </td>",
"       <td>",
"        Evident",
"       </td>",
"       <td>",
"        1. The presence of a high-risk cardiac source of cerebral embolism",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Probable",
"       </td>",
"       <td>",
"        1. Evidence of systemic embolism",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2. The presence of multiple acute infarctions that have occurred closely related in time within both right and left anterior or both anterior and posterior circulations in the absence of occlusion or near-occlusive stenosis of all relevant vessels. Other diseases that can cause multifocal ischemic brain injury such as vasculitides, vasculopathies, and haemostatic or hemodynamic disturbances must not be present",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Possible",
"       </td>",
"       <td>",
"        1. The presence of a cardiac condition with low or uncertain primary risk of cerebral embolism",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2. Evidence for evident cardio-aortic embolism in the absence of complete diagnostic investigation for other mechanisms",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" rowspan=\"5\">",
"        Small artery occlusion",
"       </td>",
"       <td>",
"        Evident",
"       </td>",
"       <td>",
"        1. Imaging evidence of a single and clinically relevant acute infarction &lt;20 mm in greatest diameter within the territory of basal or brainstem penetrating arteries in the absence of any other pathology in the parent artery at the site of the origin of the penetrating artery (focal atheroma, parent vessel dissection, vasculitis, vasospasm, etc)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Probable",
"       </td>",
"       <td>",
"        1. The presence of stereotypic lacunar transient ischemic attacks within the past week",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2. The presence of a classical lacunar syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Possible",
"       </td>",
"       <td>",
"        1. Presenting with a classical lacunar syndrome in the absence of imaging that is sensitive enough to detect small infarctions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2. Evidence for evident small artery occlusion in the absence of complete diagnostic investigation for other mechanisms",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" rowspan=\"3\">",
"        Other causes",
"       </td>",
"       <td>",
"        Evident",
"       </td>",
"       <td>",
"        1. The presence of a specific disease process that involves clinically appropriate brain arteries",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Probable",
"       </td>",
"       <td>",
"        1. A specific disease process that has occurred in clear and close temporal or spatial relationship to the onset of brain infarction such as arterial dissection, cardiac or arterial surgery, and cardiovascular interventions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Possible",
"       </td>",
"       <td>",
"        1. Evidence for an evident other cause in the absence of complete diagnostic investigation for mechanisms listed above",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" rowspan=\"7\">",
"        Undetermined causes",
"       </td>",
"       <td>",
"        Unknown",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        Cryptogenic embolism:",
"       </td>",
"       <td>",
"        1. Angiographic evidence of abrupt cut-off consistent with a blood clot within otherwise angiographically normal looking intracranial arteries",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2. Imaging evidence of complete recanalization of previously occluded artery",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3. The presence of multiple acute infarctions that have occurred closely related in time without detectable abnormality in the relevant vessels",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Other cryptogenic:",
"       </td>",
"       <td>",
"        1. Those not fulfilling the criteria for cryptogenic embolism",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Incomplete evaluation:",
"       </td>",
"       <td>",
"        1. The absence of diagnostic tests that, under the examiner's judgment, their presence would have been essential to uncover the underlying etiology",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Unclassified",
"       </td>",
"       <td>",
"        1. The presence of &gt;1 evident mechanism in which there is either probable evidence for each, or no probable evidence to be able to establish a single cause",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Ay, H, Benner, T, Arsava, EM. A computerized algorithm for etiologic classification of ischemic stroke: the Causative Classification of Stroke System. Stroke 2007; 38:2979.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
